import React, { Component } from 'react'

class CameraItem extends Component {

    state = {
        source: this.props.source,
        name: this.props.name,
        port: this.props.port 
    }

    render(){

        let style ={
            width: '100%'
        }

        return(
            <div style={style}>
                <p style={{float: 'left', marginLeft: '0px', maxWidth: '100px', overflow: 'hidden'}}>{this.state.source}</p>
                <p style={{float: 'left', marginLeft: '30px', maxWidth: '30px'}}>{this.state.name}</p>
                <p style={{float: 'left', marginLeft: '60px', maxWidth: '30px'}}>{this.state.port}</p>
                <p style={{float: 'left', marginLeft: '100px', maxWidth: '30px'}}>edit</p>
                <p style={{float: 'left', marginLeft: '130px', marginLeft: '15px', maxWidth: '30px'}}>delete</p>
            </div>
        )
    }
}

export default CameraItem
